import React from 'react'
import serviceapi from './API/serviceapi';
import { useState } from 'react';

function Service() {
    const [SreviceData] = useState (serviceapi);
    return (
        <>
            <section className='service-main-conatoner'>
                <div className="service-container container  d-flex">
                    <h2 className='text-center fw-bold'>
                        How to send money?
                    </h2>
                    {SreviceData.map((curElem) => {
                            const { id, logo, title, info} = curElem;
                            return (
                                <>
                                <div className="row">
                                    <div className="col-12 col-lg-4 text-center work-container-subdiv" key={id}>
                                       <i class={`fontawesome-style ${logo}`}></i>
                                        <h5>{title}</h5>
                                        <p className='main-hero-para w-100'>{info}</p>
                                    </div>
                                    </div>
                                </>
                            )
                        })
                        }
                </div>
            </section>
        </>
    )
}

export default Service
